import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import AddShoplisting from './add/AddShoplisting';
import EditShoplisting from './edit/EditShopListing';

function App() {
  return (
    <Router>
        <Routes>
          <Route path="/add" element={<AddShoplisting />} />
          <Route path="/edit" element={<EditShoplisting />} />
        </Routes>
      <div className="App">
        <header className="App-header">
          <h1>Welcome to the App</h1>

          {/* Buttons to navigate to Add and Edit pages */}
          <div>
            <Link to="/add">
              <button className="nav-button">Go to Add Page</button>
            </Link>
            <Link to="/edit">
              <button className="nav-button">Go to Edit Page</button>
            </Link>
          </div>
        </header>

        {/* Define Routes */}
      </div>
    </Router>
  );
}

export default App;
